import React, { Component } from 'react';
import { connect } from 'react-redux';
import './HomeHeader.scss';

class HomeHeader extends Component {

    render() {

        return (
            <React.Fragment>
                <div className='home-header-container'>
                    <div className='home-header-content'>
                        <div className='left-content'>
                            <div className='header-bars'><i className='fas fa-bars'></i></div>
                            <div className='header-logo'>
                                <div className='logo'></div>
                                <div className='name-logo'><b>BaiAquatic</b></div>
                            </div>
                        </div>
                        <div className='center-content'>
                            <div className='child-center-content'><b>Trang chủ</b></div>
                            <div className='child-center-content'><b>Giới thiệu</b></div>
                            <div className='child-center-content'><b>Thiết kế & thi công</b></div>
                            <div className='child-center-content'><b>Danh mục sản phẩm</b></div>
                            <div className='child-center-content'><b>Chia sẻ & tin tức</b></div>
                        </div>
                        <div className='right-content'>
                            <div className='support'><i className='fas fa-question-circle'></i> Hỗ trợ</div>
                            <div className='flag'>Việt Nam</div>
                            <div className='login'>Đăng nhập</div>
                            <div className='register'>Đăng ký</div>
                        </div>
                    </div>
                    <div className='home-header-banner'>
                        <div className='title1'>HỆ THỐNG THỦY SINH</div>
                        <div className='title2'><b>THIẾT KẾ - THI CÔNG CHUYÊN NGHIỆP</b></div>
                        <div className='search'>
                            <i className='fas fa-search'></i>
                            <input type='text' placeholder='Tìm kiếm thông tin ...' />
                        </div>
                        <div className='download-app'>
                            <div className='google-play'>
                                <div className='download-title'>Tải về trên</div>
                                <div className='download-img'></div>
                            </div>
                            <div className='app-store'>
                                <div className='download-title'>Tải về trên</div>
                                <div className='download-img'></div>
                            </div>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeHeader);
